  "translationLines": [
    {
      "lineNumber": 156301,
      "originalJapaneseLine": "「リーザス北部にある、スケールの街ですね」",
      "translatedEnglishLine": "\"It's the town of Scale, located in northern Leazas.\""
    },
    {
      "lineNumber": 156302,
      "originalJapaneseLine": "「まずリーザス城から北上します」",
      "translatedEnglishLine": "\"First, we proceed north from Leazas Castle.\""
    },
    {
      "lineNumber": 156303,
      "originalJapaneseLine": "「真っ直ぐスケールを目指さんのか？」",
      "translatedEnglishLine": "\"Are we heading straight for Scale?\""
    },
    {
      "lineNumber": 156304,
      "originalJapaneseLine": "「はい、少し迂回することになりますが、",
      "translatedEnglishLine": "\"Yes, we'll take a slight detour,"
    },
    {
      "lineNumber": 156305,
      "originalJapaneseLine": "　戦地からは離れた方が良いでしょう」",
      "translatedEnglishLine": "but it's better to stay away from the battlefields.\""
    },
    {
      "lineNumber": 156306,
      "originalJapaneseLine": "「遠回りに見えますが、戦闘が少なく済みますから、",
      "translatedEnglishLine": "\"It looks like a detour, but since there will be fewer battles,"
    },
    {
      "lineNumber": 156307,
      "originalJapaneseLine": "　結果的にこちらの方が早く着くかと」",
      "translatedEnglishLine": "we'll actually arrive sooner this way.\""
    },
    {
      "lineNumber": 156308,
      "originalJapaneseLine": "「そして、プリティリアを通って魔人ハウゼルと交戦中の",
      "translatedEnglishLine": "\"Then, passing through Preteria, we'll go to Scale,"
    },
    {
      "lineNumber": 156309,
      "originalJapaneseLine": "　前線であるスケールの街へ」",
      "translatedEnglishLine": "the frontline where we are engaged in battle with the demon/general Howzer.\""
    },
    {
      "lineNumber": 156310,
      "originalJapaneseLine": "「ランス殿、このルートで宜しいですか？」",
      "translatedEnglishLine": "\"Lord Rance, is this route acceptable?\""
    },
    {
      "lineNumber": 156311,
      "originalJapaneseLine": "「おー、なんでもいいぞ。",
      "translatedEnglishLine": "\"Oh, anything's fine."
    },
    {
      "lineNumber": 156312,
      "originalJapaneseLine": "　早く着くんならな」",
      "translatedEnglishLine": "As long as we get there fast.\""
    },
    {
      "lineNumber": 156313,
      "originalJapaneseLine": "「よし、んじゃしゅっぱーつ」",
      "translatedEnglishLine": "\"Alright, let's go!\""
    },
    {
      "lineNumber": 156314,
      "originalJapaneseLine": "リーザスの大きな街道を進むランス達が、",
      "translatedEnglishLine": "Rance and the others proceeded along a large highway in Leazas,"
    },
    {
      "lineNumber": 156315,
      "originalJapaneseLine": "とある商店街に着いた。",
      "translatedEnglishLine": "and arrived at a certain shopping district."
    },
    {
      "lineNumber": 156316,
      "originalJapaneseLine": "リプ商店街――",
      "translatedEnglishLine": "Lip Shopping District――"
    },
    {
      "lineNumber": 156317,
      "originalJapaneseLine": "「ほー、いつ来てもここはすごいな」",
      "translatedEnglishLine": "\"Wow, this place is amazing no matter when I come.\""
    },
    {
      "lineNumber": 156318,
      "originalJapaneseLine": "「はい、大きなお店が両側に",
      "translatedEnglishLine": "\"Yes, large shops line both sides"
    },
    {
      "lineNumber": 156319,
      "originalJapaneseLine": "　ずらーっとどこまでも並んで壮観ですね」",
      "translatedEnglishLine": "stretching endlessly—it’s quite a sight.\""
    },
    {
      "lineNumber": 156320,
      "originalJapaneseLine": "「なんたってリーザスが誇る、",
      "translatedEnglishLine": "\"After all, this is Leazas’ pride,"
    },
    {
      "lineNumber": 156321,
      "originalJapaneseLine": "　世界一長い商店街だからね」",
      "translatedEnglishLine": "the longest shopping street in the world.\""
    },
    {
      "lineNumber": 156322,
      "originalJapaneseLine": "「あんまり長すぎて、",
      "translatedEnglishLine": "\"It's so long,"
    },
    {
      "lineNumber": 156323,
      "originalJapaneseLine": "　端から端まで、歩くだけで数日かかるんだから」",
      "translatedEnglishLine": "that it takes several days just to walk from one end to the other.\""
    },
    {
      "lineNumber": 156324,
      "originalJapaneseLine": "「リーザスの豊かさの",
      "translatedEnglishLine": "\"It’s said to be one of the symbols"
    },
    {
      "lineNumber": 156325,
      "originalJapaneseLine": "　象徴の一つと言われていますね」",
      "translatedEnglishLine": "of Leazas’ prosperity.\""
    },
    {
      "lineNumber": 156326,
      "originalJapaneseLine": "「まあ、ここだけの話、",
      "translatedEnglishLine": "\"Well, just between us,"
    },
    {
      "lineNumber": 156327,
      "originalJapaneseLine": "　JAPANにある天満橋商店街に",
      "translatedEnglishLine": "it was actually made to compete with the Tenmabashi Shopping Street in JAPAN.\""
    },
    {
      "lineNumber": 156328,
      "originalJapaneseLine": "　対抗して作られたものなんだけどね」",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 156329,
      "originalJapaneseLine": "「リアらしい話だ」",
      "translatedEnglishLine": "\"That sounds like something Ria would do.\""
    },
    {
      "lineNumber": 156330,
      "originalJapaneseLine": "戦争中にも関わらず",
      "translatedEnglishLine": "Despite the war going on,"
    },
    {
      "lineNumber": 156331,
      "originalJapaneseLine": "商店街は沢山の人でごった返していた。",
      "translatedEnglishLine": "the shopping district was crowded with many people."
    },
    {
      "lineNumber": 156332,
      "originalJapaneseLine": "「わー、すごい……",
      "translatedEnglishLine": "\"Wow, amazing..."
    },
    {
      "lineNumber": 156333,
      "originalJapaneseLine": "　かろ、こんなに沢山のお店初めて見た」",
      "translatedEnglishLine": "Karo, this is the first time I’ve seen so many shops.\""
    },
    {
      "lineNumber": 156334,
      "originalJapaneseLine": "「私もです……",
      "translatedEnglishLine": "\"Me too..."
    },
    {
      "lineNumber": 156335,
      "originalJapaneseLine": "　それにこの辺りはまだまだ人も沢山……」",
      "translatedEnglishLine": "And there are still lots of people around here...\""
    },
    {
      "lineNumber": 156336,
      "originalJapaneseLine": "「って、あら？」",
      "translatedEnglishLine": "\"Huh, oh?\""
    },
    {
      "lineNumber": 156337,
      "originalJapaneseLine": "「すっぱぱぱーん！",
      "translatedEnglishLine": "\"Supa-papan!"
    },
    {
      "lineNumber": 156338,
      "originalJapaneseLine": "　プリプリ商店街にようこそー！」",
      "translatedEnglishLine": "Welcome to Puripuri Shopping District!\""
    },
    {
      "lineNumber": 156339,
      "originalJapaneseLine": "「……先輩、リプ商店街ですわ」",
      "translatedEnglishLine": "\"...Senpai, this is Lip Shopping District.\""
    },
    {
      "lineNumber": 156340,
      "originalJapaneseLine": "「あれ？　ジュリアとチルディ？",
      "translatedEnglishLine": "\"Huh? Julia and Childi?"
    },
    {
      "lineNumber": 156341,
      "originalJapaneseLine": "　なんでお前らがここに？」",
      "translatedEnglishLine": "Why are you guys here?\""
    },
    {
      "lineNumber": 156342,
      "originalJapaneseLine": "「ランスちゃん達がこの商店街を通るって",
      "translatedEnglishLine": "\"Ria-chan heard that Rance and the others would pass through this shopping district,"
    },
    {
      "lineNumber": 156343,
      "originalJapaneseLine": "　リアちゃんが聞いてね、",
      "translatedEnglishLine": "and said to guide you around.\""
    },
    {
      "lineNumber": 156344,
      "originalJapaneseLine": "　それなら案内してきてねってー」",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 156345,
      "originalJapaneseLine": "「チルディは？」",
      "translatedEnglishLine": "\"What about Childi?\""
    },
    {
      "lineNumber": 156346,
      "originalJapaneseLine": "「ジュリア先輩のおもりですわ」",
      "translatedEnglishLine": "\"She’s looking after Senior Julia.\""
    },
    {
      "lineNumber": 156347,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 156348,
      "originalJapaneseLine": "「今日はー、ジュリア達を",
      "translatedEnglishLine": "\"Today, please think of Julia and the others"
    },
    {
      "lineNumber": 156349,
      "originalJapaneseLine": "　ツアーコンダクターだと思って楽しんでねー」",
      "translatedEnglishLine": "as your tour conductors and enjoy yourselves!\""
    },
    {
      "lineNumber": 156350,
      "originalJapaneseLine": "「ランスちゃん、コロッケ好きー？",
      "translatedEnglishLine": "\"Rance-chan, do you like croquettes?"
    },
    {
      "lineNumber": 156351,
      "originalJapaneseLine": "　ここに来たら何はなくともコロッケ食べなくちゃ」",
      "translatedEnglishLine": "If you come here, you have to eat croquettes no matter what.\""
    },
    {
      "lineNumber": 156352,
      "originalJapaneseLine": "「えへへ、お小遣いリアちゃんにもらったから、",
      "translatedEnglishLine": "\"Hehe, I got some pocket money from Ria-chan,"
    },
    {
      "lineNumber": 156353,
      "originalJapaneseLine": "　奢ってあげちゃうね」",
      "translatedEnglishLine": "so I’ll treat you.\""
    },
    {
      "lineNumber": 156354,
      "originalJapaneseLine": "「ふふん、俺様はグルメだぞ。",
      "translatedEnglishLine": "\"Hmph, I'm a gourmet."
    },
    {
      "lineNumber": 156355,
      "originalJapaneseLine": "　半端なもんは受け付けないからな」",
      "translatedEnglishLine": "I won't accept anything half-baked.\""
    },
    {
      "lineNumber": 156356,
      "originalJapaneseLine": "「はーい」",
      "translatedEnglishLine": "\"Yes!\""
    },
    {
      "lineNumber": 156357,
      "originalJapaneseLine": "「グルメって……嘘ばっかり」",
      "translatedEnglishLine": "\"Gourmet, huh... that's all lies.\""
    },
    {
      "lineNumber": 156358,
      "originalJapaneseLine": "「んっ、んんっ！",
      "translatedEnglishLine": "\"Nn, nn!"
    },
    {
      "lineNumber": 156359,
      "originalJapaneseLine": "　物見遊山に来たわけではないことをお忘れなく」",
      "translatedEnglishLine": "Don't forget, we're not here sightseeing.\""
    },
    {
      "lineNumber": 156360,
      "originalJapaneseLine": "「腹が減っては戦はなんちゃらだ。",
      "translatedEnglishLine": "\"An army marches on its stomach, or whatever they say."
    }
  ]
}

